import React, { useState } from 'react'

function Data() {
    const [Data] = useState ([
        {
            title:'canggu',
            artist: 'french kiwi',
            cover: './images/kay-the-great.jpg',
            year: '2022',
            src:'./music/FKJ_-_Canggu(128k).mp3',
        },
        {
            title:'blessed',
            artist: 'french kiwi',
            cover: './images/kay-the-great.jpg',
            year: '2022',
            src:'./music/FKJ_-_Canggu(128k).mp3',
        },
        {
            title:'die with a smile',
            artist: 'french kiwi',
            cover: './images/music.jpg',
            year: '2022',
            src:'./music/FKJ_-_Die_with_a_Smile(128k).mp3',
        },
    ])
  return (
    <div>Data</div>
  )
}

export default Data
